ody = null;     let modelError = null;      // Try primary model first     try {       console.log(chalk.dim(`Using Amazon Q model: ${modelId}`))       responseBody = await invokeModel(modelId, prompt);       return responseBody.completion;     } catch (error: any) {       modelError = error;       console.error(chalk.yellow(`Error with primary model ${modelId}: ${error.message}`));              // Try fallback models       for (const fallbackModel of FALLBACK_MODELS) {         try {           console.log(chalk.dim(`Trying fallback model: ${fallbackModel}`));           responseBody = await invokeModel(fallbackModel, prompt);

/*!  * Copyright Amazon.com, Inc. or its affiliates. All Rights Reserved.  * SPDX-License-Identifier: Apache-2.0  */ import * as vscode from 'vscode' import { CodeScanIssue } from '../models/model' import globals from '../../shared/extensionGlobals' import { telemetry } from '../../shared/telemetry/telemetry' import path from 'path' import { AuthUtil } from '../util/authUtil' import { TelemetryHelper } from '../util/telemetryHelper' import { SecurityIssueProvider } from './securityIssueProvider'  export class SecurityIssueHoverProvider implements vscode.HoverProvider {     static #instance: SecurityIssueHoverProvider     private issueProvider: SecurityIssueProvider = SecurityIssueProvider.instance      public static get instance() {         return (this.#instance ??= new this())     }      public provideHover(         document: vscode.TextDocument,         position: vscode.Position,         _token: vscode.CancellationToken     ): vscode.Hover {         const contents: vscode.MarkdownString[] = []          for (const group of this.issueProvider.issues) {             if (document.fileName !== group.filePath) {                 continue             }              for (const issue of group.issues) {                 if (!issue.visible) {                     continue                 }                 const range = new vscode.Range(issue.startLine, 0, issue.endLine, 0)                 if (range.contains(position)) {                     contents.push(this._getContent(group.filePath, issue))                     telemetry.codewhisperer_codeScanIssueHover.emit({                         findingId: issue.findingId,                         detectorId: issue.detectorId,                         ruleId: issue.ruleId,                         includesFix: !!issue.suggestedFixes.length,                         credentialStartUrl: AuthUtil.instance.startUrl,                         autoDetected: issue.autoDetected,                     })                     TelemetryHelper.instance.sendCodeScanRemediationsEvent(                         document.languageId,                         'CODESCAN_ISSUE_HOVER',                         issue.detectorId,                         issue.findingId,                         issue.ruleId,                         undefined,                         undefined,                         undefined,                         !!issue.suggestedFixes.length                     )                 }             }         }          return new vscode.Hover(contents)     }      private _getContent(filePath: string, issue: CodeScanIssue) {         const markdownString = new vscode.MarkdownString()         markdownString.isTrusted = true         markdownString.supportHtml = true         markdownString.supportThemeIcons = true         markdownString.baseUri = vscode.Uri.file(path.join(globals.context.extensionPath, 'resources/images/'))          const [suggestedFix] = issue.suggestedFixes          markdownString.appendMarkdown(`## ${issue.title} ${this._makeSeverityBadge(issue.severity)}
`)         markdownString.appendMarkdown(             `${suggestedFix?.code && suggestedFix.description !== '' ? suggestedFix.description : issue.recommendation.text}

